import re
from __future__ import print_function

def normalise(s):
    out = re.split(r'[/|\-|_|\.]', s)
    if '' in out: out.remove('')
    return " ".join(out)+". "

def domain_string(domain, path_set):
    out = normalise(domain)
    for p in path_set: out += normalise(p)
    return out
